import React from 'react'
import styled from 'styled-components';
import productdata from '../data/data'
const Containner = styled.div`
  display: flex;
`
const products = () => {
  return (
    <Containner>
    {productdata.map((item)=>(
        <Product item={item} key={item.id} />
        ))}
</Containner>
  )
}

export default products
